import React from 'react';

const Projects: React.FC = () => {
    const projectList = [
        {
            title: 'Project One',
            description: 'A brief description of Project One, highlighting its purpose and features.',
            role: 'Role in Project One',
            technologies: ['Tech1', 'Tech2', 'Tech3']
        },
        {
            title: 'Project Two',
            description: 'A brief description of Project Two, highlighting its purpose and features.',
            role: 'Role in Project Two',
            technologies: ['Tech1', 'Tech2', 'Tech3']
        },
        {
            title: 'Project Three',
            description: 'A brief description of Project Three, highlighting its purpose and features.',
            role: 'Role in Project Three',
            technologies: ['Tech1', 'Tech2', 'Tech3']
        }
    ];

    return (
        <section id="projects">
            <h2>Projects</h2>
            <div className="project-list">
                {projectList.map((project, index) => (
                    <div key={index} className="project-item">
                        <h3>{project.title}</h3>
                        <p>{project.description}</p>
                        <p><strong>Role:</strong> {project.role}</p>
                        <p><strong>Technologies:</strong> {project.technologies.join(', ')}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default Projects;
